import React from 'react'
import { useNavigate } from 'react-router-dom'

const naviagte = useNavigate();

const handleSubmit = () => {
    naviagte('/');
}

const Deposit = () => {
    return (
        <div>
            <div>
                <h1>Deposit</h1>
                <form className='border w-50 p-3 ' style={{ justifyContent: 'center', textAlign: 'center', margin: 'auto' }} onSubmit={handleSubmit}>
                    <div class="mb-3 mt-3 ">
                        <input type="text" class="form-control" id="deposit" placeholder="Enter Money" name="Money"/>
                    </div>
                    <div>
                    <button className='btn btn-outline-success'>Confirm</button>
                    </div>
                </form>
            </div>
        </div>
    )
}

export default Deposit
